function main(player,  reinLevel)
	local reinLevel = tonumber(reinLevel)
	--print(reinLevel)
	local reinNum = lualib:GetInt(player, "reinNum")
	if lualib:Level(player) < rein_att_t[reinLevel][3] then
		return "你的等级不足，当前转生需要"..rein_att_t[reinLevel][3].."级！"
	end
	
	if reinNum >= 5 then
		return "你已达到最高转生等级5转。"
	end
	
	
	if not lualib:Player_IsGoldEnough(player,  rein_att_t[reinLevel][4],  false) then
		return "你的金币不足"..rein_att_t[reinLevel][4].."，无法转生！"
	end
	
	if lualib:ItemCountByKey(player, "转生石",  true,  false,  false, 2) < rein_att_t[reinLevel][5] then
		return "你的转生石不足"..rein_att_t[reinLevel][5].."，无法转生！"
	end
	
	if reinNum + 1 ~= reinLevel then
		return "转生阶段不正确！"
	end
	
	if reinNum == 50 then 
		return "你的转生境界已经为最高！"
	end
	
	if lualib:Level(player) > 80 then
		return "当前等级不能转生"
	end
	
	if not lualib:Player_SubGold(player,  rein_att_t[reinLevel][4],  false,  "转生非绑",  "") then return "扣除金币失败" end
	
	if not lualib:DelItem(player,  "转生石",  rein_att_t[reinLevel][5],  2,  "",  "") then return "扣除转生石失败" end
	local player_lv = lualib:Level(player)
	local setLevel = rein_att_t[reinLevel][3] - rein_att_t[reinLevel][6]
	lualib:Player_RunGMCmd(player,  "sa",  "0 "..setLevel)
	
	
	local setExp = 0
	if player_lv > rein_att_t[reinLevel][3] then
		for i = rein_att_t[reinLevel][3],  rein_att_t[reinLevel][3] + player_lv - rein_att_t[reinLevel][3] - 1 do
			--setExp = setExp + rein_att_t[i][1]
			if not lualib:Player_AddExp(player,  rein_att_t[i][1],  "",  "") then return "转生调整经验失败，请联系GM！" end
		end
	end
	--print(setExp)
	--if not lualib:Player_AddExp(player,  setExp,  "",  "") then return "转生调整经验失败，请联系GM！" end
	
	
	local addatt = 0
	local job = lualib:Job(player)
	for i = 1,  #rein_att_t[reinLevel][7][job] do
		lualib:SetDynamicAttr(player,  addatt,  rein_att_t[reinLevel][7][job][i],  rein_att_t[reinLevel][8][job][i])
		addatt = addatt + 1
	end
	local title = {
						{81, 83, 85},
						{82, 84, 86},
					}
	local gender = lualib:Gender(player)
	lualib:AddTitle(player, title[gender][job])
	lualib:SetInt(player,  "reinNum",  reinLevel)
	lualib:SetStr(player, "_name_t", "转生等级:"..reinLevel.."转")
	lualib:SetStr(player, "_na_", "转生等级:"..reinLevel.."转")
	lualib:NotifyVar(player, "_name_t")
	lualib:NotifyVar(player, "_na_")
	return ""
end